Я - психолог, специалист в области педагогики, психогенетики, подростковой и семейной психологии, системный психотерапевт. 
Более 12 лет провожу детскую, педагогическую, персональную и семейную психотерапию : как в индивидуальном, так и в групповом формате. 
В своей базе имею классическое психологическое образование - Санкт-Петербургская Высшая Академия Педагогики (АППО), экономическое образование в сфере Управления (ИНЖЕКОН), Академия ИДЕАЛ-метода Тойча (ATIM), авторские курсы И. Линдевальдт. 

В совершенстве владею английским языком и постоянно прохожу дистанционное обучение у коллег из Австралии, Великобритании и Соединенных Штатов, которые стоят на самой передовой ступени изучения и практики современных направлений мировой психотерапии. Среди них Л.Хэй, М.Л.Шульц, Д.Вирче, Д. Уивер и многие другие.
Так же, более 15 лет преподаю английский язык с использованием психологической методики, эффективно растворяющей языковой барьер. 

Мой подход в работе с любыми задачами, которые ставит перед собой каждый приходящий на мои занятия, заключается в "переключении" человека из плоскости "проблемы" в плоскость " решения", где становиться видно, куда идти дальше , что трансформировать, а что отпустить. 
И , таким образом, снова ощутить себя архитектором своей жизни. 
На своих занятиях, я показываю каждому, как он может научиться быть уверенным в своих силах и жить с вдохновением. 

За годы психотерапевтической практики мне удалось создать свой уникальный авторский подход, сочетающий в себе несколько направлений. Это:
- работа с энергиями ( на основе метода системных расстановок Берта Хеллингера);
- работа с аффирмациями ( трансформация унаследованных и приобретенных верований, тормозящих движение вперед);
- анализ генетического кода и выявление Лучших и Сильных сторон, на которые можно опереться и которые есть у Каждого человека без исключения;
- работа с энергией негативных эмоций - EFT Tapping - Техника эмоционального высвобождения ( революционная техника каждодневной самопомощи, соединяющая в себе приемы акупрессуры и работы с аффирмациями);

Я провожу идивидуальные консультации, групповые тематические семинары, системные расстановки в Санкт-Петрбурге, Кингисеппе, Нарва-Йыесуу
( Эстония) на регулярной основе. 

Запросы, с которыми Вы можете обращаться ко мне:
- поиск своего направления;
- психосоматические состояния ( болезни, часто появляющиеся симптомы, необъяснимые физические состояния);
- повторяющиеся ситуации из прошлого ( как в роду, так и в отношениях);
- поиск "спутника жизни";
- выстраивание мирного и счастливого климата в семье;
- разрешение споров и конфликтов на работе и в личных отношениях;
- потеря контакта с Источником Вдохновения;
- восстановление после развода, потерь и перемен;
- другие истории, в которых человек не видит выхода.
